import React from 'react';
import './style.css';

    const CARD = props => {
        return (
            <div className="card text-center" style="width: 50rem">
                <div className="card-body">
                    <h4 className="card-title">{props.name}</h4>
                    <p className = "card-text">{props.nickname}</p>
                    <a href="hildegard.org">{props.website}</a>
                </div>
            </div>
        );
    }

export default CARD;
